import React from 'react'
import {
    Container,
    Form,
    FormControl,
    Nav,
    Navbar,
    NavDropdown,
  } from "react-bootstrap";
function Footer() {
  return (
    <Navbar fixed="bottom" bg="dark" variant="dark">
    <Container>
      <Navbar.Text>
        &copy; 2024 Your Company Name
      </Navbar.Text>
    </Container>
  </Navbar>
  )
}

export default Footer
